To install the required Neovim plugins, open the ~/.config/nvim/init.lua file you created earlier. Near the top, where you see the other use statements, add the following snippet of Lua code, which will install octo.nvim and op.nvim: use({ 'pwntester/octo.nvim', requires = { -- 1Password plugin for Neovim 'mrjones2014/op.nvim', -- another plugin to make the UI a bit nicer 'stevearc/dressing.nvim', },
}) Next, jump to near the bottom of the file, add a new section for the configuration of the octo.nvim plugin, and add the following code: require('octo').setup({ gh_env = function() -- the 'op.api' module provides the same interface as the CLI -- each subcommand accepts a list of arguments -- and returns a list of output lines. -- use it to retrieve the GitHub access token from 1Password local github_token = require('op.api').item.get({ 'GitHub', '--fields', 'token' })[1] if not github_token or not vim.startswith(github_token, 'ghp_') then error('Failed to get GitHub token.') end -- the values in this table will be provided to the -- GitHub CLI as environment variables when invoked, -- with the table keys (e.g. GITHUB_TOKEN) being the -- environment variable name, and the values (e.g. github_token) -- being the variable value return { GITHUB_TOKEN = github_token } end,
}) Then, close and reopen Neovim, and run the :PackerSync<Enter> command to install the new plugins and apply configuration changes. With this configuration, the octo.nvim plugin will automatically request authorization via 1Password CLI, and if enabled, even use biometric authentication via 1Password! To try it out, open Neovim from a GitHub repository directory and run :Octo issue list to list issues in the GitHub repository. Enjoy using in Neovim! If you run into any snags or just want to share your experience, join us in the 1Password Developer Slack .

