With this information, you can set your desktop wallpaper declaratively within your home-manager configuration. You can use pkgs.fetchurl to fetch the desired image file and set it as your desktop wallpaper: { pkgs, ... }:
let wallpaperImg = pkgs.fetchurl { url = "https://url/to/your/image"; # replace this with the SHA256 hash of the image file hash = "sha256-AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA"; };
in { dconf.settings = { "org/gnome/desktop/background" = { picture-uri = "file://${wallpaperImg}"; }; };
} With this added, applying your home-manager configuration will change your desktop wallpaper! You can use this method to find just about all the settings you'll need, although some of them might require some fiddling with. For example, creating custom keyboard shortcuts is slightly more complex. First, you have to specify each custom shortcut group that should exist, then you can specify the shortcuts themselves. For example: { pkgs, ... }: { dconf.settings = { "org/gnome/settings-daemon/plugins/media-keys" = { # specify that custom shortcut "custom0" should exist and be included custom-keybindings = [ "/org/gnome/settings-daemon/plugins/media-keys/custom-keybindings/custom0/" ]; terminal = [ "" ]; }; # now you can specify the "custom0" shortcut itself "org/gnome/settings-daemon/plugins/media-keys/custom-keybindings/custom0" = { binding = "Print"; # printscrn key command = "flameshot gui"; name = "flameshot"; }; };
} Feel free to take a look at all the current settings I use at time of writing in my dotfiles repo .
